import './App.css';
import Card from './components/Card';
import { Route, Switch, Redirect } from 'react-router-dom';

function App() {
  return (
    <Switch>
      <Route exact path="/" component={Card} />
      <Redirect to="/" />
    </Switch>
  );
}

export default App;
